import { useState} from "react"

function Welcome(){
    return <p>Hello world</p>
}




function App() {
    const [count, setCount] = useState(0)
    return (
        <div className = "div">
            <h1 className = "Greeting">Hello world</h1>
            <button onClick = {() => setCount(count++)}>A button </button>
        </div>
    )
}
export default App
